To use any of the sub-crate as a dependency in your own project, you can specify the dependency as follows, [dependencies]
...
liboci-cli = { git = "https://github.com/containers/Youki.git" }
... Here we use liboci-cli as an example, which can be replaced by the sub-crate that you need. Then you can use it in your source as use liboci_cli::{...}
